import React from 'react';
import TaskList from './components/TaskList';
import { CssBaseline, ThemeProvider, createTheme } from '@mui/material';
import './App.css';

const theme = createTheme({
    palette: {
        primary: {
            main: '#3f51b5',
        },
        secondary: {
            main: '#f50057',
        },
    },
});

function App() {
    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <div className="App">
                <h1>To-Do List</h1>
                <TaskList />
            </div>
        </ThemeProvider>
    );
}

export default App;
